import React from "react";

const metrics = [
  {
    icon: <svg width="24" height="24" fill="none"><path d="M4 18l6-7 5 5 5-8" stroke="#1976d2" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/><circle cx="19" cy="6" r="2" fill="#1976d2"/></svg>,
    label: "Strateji Getirisi",
    value: "195.62%"
  },
  {
    icon: <svg width="24" height="24" fill="none"><path d="M4 18l6-7 5 5 5-8" stroke="#ff9800" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/><circle cx="19" cy="6" r="2" fill="#ff9800"/></svg>,
    label: "Al & Tut Getirisi",
    value: "213.44%"
  },
  {
    icon: <svg width="24" height="24" fill="none"><rect x="4" y="6" width="16" height="12" rx="2" stroke="#666" strokeWidth="2"/><path d="M8 10h8M8 14h4" stroke="#666" strokeWidth="2"/></svg>,
    label: "İşlem Sayısı",
    value: "64"
  },
  {
    icon: <svg width="24" height="24" fill="none"><rect x="4" y="6" width="16" height="12" rx="2" stroke="#666" strokeWidth="2"/><path d="M8 10h8M8 14h4" stroke="#666" strokeWidth="2"/><rect x="7" y="3" width="2" height="4" rx="1" fill="#666"/><rect x="15" y="3" width="2" height="4" rx="1" fill="#666"/></svg>,
    label: "Aylık Ortalama İşlem",
    value: "1.16"
  },
  {
    icon: <svg width="24" height="24" fill="none"><path d="M4 18l6-7 5 5" stroke="#388e3c" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/><circle cx="19" cy="6" r="2" fill="#388e3c"/></svg>,
    label: "Ortalama İşlem Getirisi",
    value: "1.89"
  },
  {
    icon: <svg width="24" height="24" fill="none"><path d="M4 6l8 8 8-8" stroke="#d32f2f" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/><path d="M12 14v4" stroke="#d32f2f" strokeWidth="2" strokeLinecap="round"/></svg>,
    label: "Maksimum Drawdown",
    value: "16.59%"
  },
  {
    icon: <svg width="24" height="24" fill="none"><path d="M4 18l6-7 5 5" stroke="#1976d2" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/><circle cx="19" cy="6" r="2" fill="#1976d2"/></svg>,
    label: "Sharpe Oranı",
    value: "1.17"
  },
  {
    icon: <svg width="24" height="24" fill="none"><path d="M4 18l6-7 5 5" stroke="#8e24aa" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/><circle cx="19" cy="6" r="2" fill="#8e24aa"/></svg>,
    label: "Sortino Oranı",
    value: "1.73"
  }
];

export default function StratejiPerformansOzeti() {
  return (
    <div style={{
      background: '#fff',
      borderRadius: 20,
      boxShadow: '0 2px 12px rgba(0,0,0,0.07)',
      padding: '32px 28px 18px 28px',
      maxWidth: 700,
      margin: '32px auto',
      border: '1px solid #e0d4c4',
    }}>
      <h2 style={{fontWeight: 600, fontSize: 28, marginBottom: 24}}>Strateji Performans Özeti</h2>
      <div style={{
        display: 'grid',
        gridTemplateColumns: '1fr 1fr',
        gap: 0,
        borderTop: '1px solid #e0d4c4',
        borderBottom: '1px solid #e0d4c4',
      }}>
        {metrics.map((m, i) => (
          <div key={m.label} style={{
            display: 'flex',
            alignItems: 'center',
            padding: '18px 0',
            borderRight: i % 2 === 0 ? '1px solid #e0d4c4' : 'none',
            borderBottom: i < 6 ? '1px solid #e0d4c4' : 'none',
            gap: 16,
            fontSize: 18,
            fontWeight: 500,
          }}>
            <span style={{width: 32, display: 'flex', justifyContent: 'center'}}>{m.icon}</span>
            <span style={{flex: 1}}>{m.label}</span>
            <span style={{fontWeight: 600, fontSize: 20, minWidth: 80, textAlign: 'right'}}>{m.value}</span>
          </div>
        ))}
      </div>
      <div style={{color: '#888', fontSize: 15, marginTop: 18}}>
        Bu metrikler seçili stratejiye göre hesaplanmıştır.
      </div>
    </div>
  );
}
